import React from 'react';
import { View, StyleSheet, TouchableOpacity } from 'react-native';
import { Link } from "react-router-native";
import Text from './Text';

const styles = StyleSheet.create({
  container: {
    flexDirection:'row',
    backgroundColor: "#24292e",
    height: 50,
    paddingLeft:10,
    paddingRight:10,
    justifyContent: 'flex-start',
    alignItems:'center'
  },
  buttons: {
    marginTop: 10,
  },
  menues: {
    width:100,
    color: 'white',
    fontSize: 14,
    fontWeight: "500",
  }
});

const repositoriesButton = () =>{
  return (
    <TouchableOpacity>
        <Text style={styles.menues} >Repositories</Text>
      </TouchableOpacity>
  );
};

const AppBar = () => {
  return (
    <View style={styles.container}>
      {/* <TouchableWithoutFeedback>
        <Text style={styles.menues} >Repositories</Text>
      </TouchableWithoutFeedback>
      <TouchableWithoutFeedback>
        <Text style={styles.menues} >Sign in</Text>
      </TouchableWithoutFeedback> */}
      {/* <Link to="/" component={repositoriesButton} activeOpacity={0.8} /> */}
      <Link to="/SignIn" component={repositoriesButton} activeOpacity={0.8} />
    </View>
  );
};

export default AppBar;
